import React from 'react'
import styles from '../styles/FormRegister.module.css'
function FormRegister() {
    return (
        <div className="form-register-parent">
            <div className="form-register">
                <div className="form-register-img">
                    <img src="https://www.weluck.vn/img/banner-signup.0dd5ee94.jpg" alt="img-form"></img>
                </div>
            </div>
        </div>
    )
}

export default FormRegister;
